 &lt;/li&gt;\n&lt;li&gt; disk-read time: 78.37 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 1.64 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:34815 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 10 &lt;/li&gt;\n          &lt;li&gt; Memory: 540.94 GB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2.30.0+91.g2a7ab529 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2.31.0.dev0+68.g7ea9696c &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1244","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1274","type":"Selection"},{"attributes":{"factors":[]},"id":"1184","type":"FactorRange"},{"attributes":{},"id":"1116","type":"LinearScale"},{"attributes":{"dimensions":"width"},"id":"1091","type":"WheelZoomTool"},{"attributes":{"factors":["a","b"]},"id":"1152","type":"FactorRange"},{"attributes":{},"id":"1186","type":"LinearScale"},{"attributes":{},"id":"1240","type":"BasicTickFormatter"},{"attributes":{},"id":"1276","type":"Selection"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1276"},"selection_policy":{"id":"1277"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"@type: @bandwidth_text / s"},"id":"1208","type":"HoverTool"},{"attributes":{"dimensions":"width"},"id":"1056","type":"WheelZoomTool"},{"attributes":{"overlay":{"id":"1023
